May 21, 2019 - For Immediate Release

LaFayette voters approve $19.5 million budget, elect board members

On May 21, LaFayette Central School District voters approved the district’s $19.5 million 2019-2020 budget proposal, elected two board of education members and approved purchasing three new vehicles.

Voters approved:

An $19,567,132 budget for the 2019-2020 school year that increases spending 3.18 percent and carries a 2.51 percent tax levy increase: 115 yes, 30 no;

Purchasing three new student transportation vehicles at a total cost not to exceed $225,000: 109 yes, 35 no;

Voters also elected two candidates for the two open board of education seats:
· Stephanie Dow: 122 votes;
· Matthew Walker: 128 votes;

The two candidates will serve three-year terms, beginning July 1, 2019. These results do not include absentee ballots.

